					["TX"] = "A leash of chain that can be loosened from its coil around the handlers arm to allow the hound much more free movement. The strong metal-looped chain leash is often kept tightly coiled; Untill a situation calls for its release. \n\nHalf way along these loops is a release pin keeping both halves locked together.",
