				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Appearance.",
						["IC"] = "inv_misc_steelweaponchain",
						["TX"] = "Human form:\nFloyd's human form is the form he uses mostly. His skin has a dark tone over it. His hair and beard is raven dark, and seems to be un-kept, wild and ruffled. His left eye is Ocean blue while the other is covered with an eye-patch, and underneath is an eye without color, due to a large scar going up from his cheek over his eye, and up to his eyebrow. His face has quite a few scars here and there. Seems like quite the Veteran.\n\nWorgen Form:\nFloyd's Worgen is rarely used these days. But when finally used, he would have completely dark fur, almost invisible in the dark. His eyes burning red, and his fur un-kept as well. His fangs and claws average length, yet sharp as knives. His upper body and arms would be covered in scars from previous battles. ",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Weaponry.",
						["IC"] = "inv_misc_pyriumgrenade",
						["TX"] = "Floyd carries a revolver in his belt. Seems to be crafted by Gilnean hands. The handle made of wood and the body of pure Iron. It can carry up to six bullets in total before it needs reloading. \n\nOn each side of his hip he carries a dagger. Each made of Dark Iron Steel. Rare and tough steel. On the body on each dagger Floyd has carved a line from each kill. \n\nIn Floyd's chest belt there seem to be hanging a lot of different Granades. Smoke bombs, Flash Bangs, Explosive Granades and Gas. \n\nOn his back he carries a good old Gilnean sniper rifle. A nice wooden body and Iron Caliber. Floyd crafted his own sniper sight from and old binocular he found in Booty Bay. ",
