					{
						["TX"] = "Apparel\n\nJayred's clothes look fairly typical for a poor human commoner, and they're worn but well-fitted upon his brawny physique. His brown sleeveless leather vest looks rugged and weathered, likely ruined by past rains. The dark linen pants he wears are likewise in a poor condition, though reparations have been attempted with various patches.\n\nA simple, sturdy club with metal studs has been strapped to Jayred's belt, and the hilt of a small boot-knife can be seen peeking out of his right boot. A pair of simple brass knuckledusters can also be spotted hanging from his belt next to a small pouch of coins, which lets out an occasional jingle as he walks.\n",
