			["about"] = {
				["read"] = true,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}{col:327c33}Ezohika Smith{/h1}{/col}\n{h2:c}{link*https://68.media.tumblr.com/a39f8759496d9590181144245db67cd9/tumblr_opjuveOVcd1tmumsso1_1280.jpg*Ezohika in Nouveau (Image)}{/h2}\n\n{h3}Notable features{/h3}\nBefore you stands a tall, proud and handsome woman. Her skin a rich teakwood and her wavey hair as dark as night, just past her ears.\nEzohika's face is feminine with hints of androgynous, angular features; elaborating further, her jaw is sharp and her eyes are striking, contrasting the dark skin around them with the brightness of her iris' current shade, be it brown or gold. Her lips are pillowy, soft and rich. An element of cuteness is held within the freckles blanketting her button nose, but that's about as far as it goes.\n\nEzohika's body is toned, slim and pear-shaped all at once. She stands strong, and walks firm with muscular legs from travelling far over Azeroth. Her arms are detailed lightly with scars from past battles.\n\n{h3}Worgen/Post-Worgen{/h3}\nEzohika's Worgen form is foreboding at best, though there is a sense of humanity in her striking, golden eyes. Her fur is almost as dark as her mane, allowing her to creep easily in the shadows. \nYou would be able to tell that Ezohika's been in her Worgen form due to the same brightness lingering in her iris, as well as her canine teeth being slightly larger than prior to her change in form.\n\n\n\n\n{img:Interface\\PETBATTLES\\Weather-Darkness:512:128}\n{h3}Social Observations{/h3}\n\nEzohika, despite her standoffish exterior would be more approachable than one would expect. She addresses you politely, and gives you her full attention should you have anything you wish her to hear. Her gaze is somewhat intense, but is often lightened by her friendly smirk, which is only just about seen over her usual neckguard.\n\nEzohika's demeanor remains relatively consistant, from accquaintances to those who are close to her; in the sense that she would much rather observe a dynamic than shift it herself, unless absolutely neccesary.\n\n\n\n",
				},
