						["TX"] = "Resting atop Dell's head would always be his hat, a simple brown leather Westfall rancher hat with a black lash around it. \n\nTucked into the lash would be a small seagull feather.\n\nIf you was to ever look inside the hat you'd see a small piece of cloth with the writing, \"Made by Marston 'N' Co, first street Moonbrook.\"",
