						["TI"] = "Gunslinger's Gear.",
						["IC"] = "Trade_Archaeology_Decorated Leather Boot Heel",
						["TX"] = "Dell would always be seen wearing a belt and brown leather bandolier draped over his chest. He'd also have a brown wolf skin cloak covering on his right shoulder discreetly hiding the revolver holster attached to his belt and on his right thigh.\n\nHe'd have a brown kodo-skin belt with a silver belt buckle.\n\nAttached to his belt would be several kodo-skin pouches, all of them having a small metal latch. Discreetly tucked in the back of his belt would be a stick of long-fuse dynamite.\n\nAs for the bandolier it'd have a small tube across it, usually with a scroll of some kind resting inside. Just above the scroll holder would be a few extra bullets slotted into the leather. Just in case!\n\nCovering on his right shoulder would be a brown wolf-skin cloak, looking rather tattered at the ends with holes and missing skin.\n\nHe'd be wearing snakeskin boots, making a small metallic-clicking sound as he'd walk due to his silver spurs.",
