				["T1"] = {
					["TX"] = "{h1:c}Appearance{/h1} \n\n{col:d7d7d7}Standing around six-foot, one, Dell would seem to be a quiet figure, always seeking to blend in seamlessly with his environment as he'd walk around.\n\nBodywise Dell would be a stocky man, clearly someone who can take punches just as hard as he dishes 'em out, however still looking rather athletic with especially toned legs.\n\nHair wise Dell would have a short hair-cut, usually having it all combed backwards when he'd wear his hat, his facial hair would be kept to a strict standard, being carefully and precisely cut.\nAlthough at times Dell could be seen with some stubble.\n\nFacially Dell looks youthful although a bit gruff and worn at places, showing a few lines along with having just generally sun-bleached skin, his piercing green eyes would be overshadowed only by the large unsightly scar crossing horizontally over the bridge of his nose.{/col}\n\n{link*https://tinyurl.com/lskf9oq*Argent Archives}\n\n{col:d9caff}============================================================{/col}\n{h1:c}Equipment{/h1}\n\n{col:d7d7d7}He would always be seen wearing a belt and brown leather bandolier draped over his chest. He'd also have a brown wolf skin cloak covering on his right shoulder, discreetly hiding the revolver holster.\n\nHe'd have a brown kodo-skin belt with a silver belt buckle with the letters, Attached to his belt would be several kodo-skin pouches, all of them having a small metal latch, keeping them shut. Discreetly tucked in the back of his belt would be a stick of long-fuse dynamite.\n\nAs for the bandolier It'd have a small tube across it, usually with a scroll of some kind resting inside. Just above the bandolier would be a few extra bullets slotted into the leather. Just in case!\n\nCovering on his right shoulder would be a brown wolf-skin cloak, looking rather tattered at the ends with holes and missing skin.\n\nHe'd be wearing snakeskin boots, making a small metallic clicking sound as he'd walk due to his silver spurs.\n\nResting atop Dell's head would always be his hat, a simple brown leather Westfall rancher hat with a black lash around it. Tucked into the lash would be a small seagull feather.\n\nResting comfortably in his thigh holster would be a expensive looking revolver, it features a dark finish with intricate engravings etched all around the weapon. \nThe hand grip has the symbol of The Alliance, a lion.\n\nNothing about the mechanics of the revolver would be too fancy, not being a double-action or having a speed loader.{/col}\n\n{col:d9caff}============================================================{/col}\n",
