						["TI"] = "Appearance",
						["IC"] = "Garrison_Building_SalvageYard",
						["TX"] = "As she walks through the city, she wears a beautiful grey/blue colored dress with golden linings. This dress is very precious to her.\n\nAlong with her lantern, she has a very small dagger at the side of her belt.  She tries to look her best by always making sure her hair looks neat and that her nails as well always look as clean as they can. \n\nHer hair is about shoulder length, her haircolor is that of a cold ashy blond color. Her skin is very pale and goes well with her over all, pale and dusty apperance. ",
