			["time"] = 1498596807,
			["zone"] = "Stormwind City",
			["about"] = {
				["T1"] = {
					["TX"] = "\n\n{h1:c}  {col:a05453}Nina-Maria Tereza Cutley{/col}\n{/h1}\n\n\n\n{h1:c} {icon:ACHIEVEMENT_BOSS_GRANDWIDOWFAERLINA:25}{/h1}\n{h1:c}{col:ff988b} Apperance {/col} {/h1}\n{col:b2796b} Nina would be the perfect example of a very small and fragile looking  lady. She is short and has a very petite body with a lovely pear shape. What would be  first noticable with Nina is her very visible collar bones, and her small yet feminine shoulders. Her long and  gentle looking neck and her slender and petite, yet long fingers. \n\nHer over all apperance is  very pale and a bit bland in comparrison to other women. Even though she looks pale and not at all very eye catching due to her natural colors, her ashy blonde hair color togheter with her lovely pale skin and dark grey eyes, would not stop someone from noticing her kind and gentle nature. She would look rather mysterious and yet.. Magical in a way. \n {/col}{h1:c}{icon:Trade_Archaeology_Draenei Candelabra:25} {/h1}\n{h1:c}{col:ff988b} Personality {/col} \n{/h1}\n {col:b2796b} \nNina could be compared to that of a candle light. A gentle, welcoming, yet warm and comforting flame.. But whom can grow fierce and strong if a wrong gust of wind blows. \nHer shy and overly kind nature allows her to speak kindly and yet with understanding, to other people. Talk to her often and you will notice a much stronger character who might even have some jokes up  her sleeve.{/col}\n\n{h1:c} {icon:INV_Misc_Book_07:25} {/h1}\n{h1:c}{col:ff988b} History {/col} {/h1}\n\n {col:b2796b} \n Due to her kind spirit, If you ask her about her past, she would most likely tell you about it. \n\n {/col}\n  \n{h1:c}{icon:TRADE_ARCHAEOLOGY_DELICATEMUSICBOX:25} {/h1}\n{h1:c}{col:ff988b} Other {/col} \n{/h1}\n\n{p:c} {link*https://www.youtube.com/watch?v=kcihcYEOeic&feature=youtu.be&t=9s*Nina's Theme}\n {/p}\n",
