				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Windy:512:128}\n{col:f2fffe}His face can be defined by severe lines, the skin looking almost unnaturally pale, his complexion unblemished apart from faint scars that sparsely litter it, relatively few signs of decay. His bald head, carrying a slight stubble, dulled blond the same shade as his brows, marked with the same damage that is found on the rest of his form. His eyes look almost weary, his brows slightly frazzled, ears and nose fully formed following the mould of his features, looking immaculate if not for discolourations across them.\n\nHis body carrying the lithe bulk of a spellcaster, thin muscle evenly spread yet their form is twisted ever so slightly, appearing slightly eerie. The same disfigurements that cover his face echoed on the rest of his body, abnormally pale skin etched with tapestry of scars. His hands appear have taken the greater of burden, seemingly little more than burnt flesh and gnarled bone. \n\nHis voice is calm but firm within a keen intelligence can be heard hardened by conviction yet seems almost haunted. His stance unyielding, firm and alert yet never resting entirely at ease. {/col}",
