			["time"] = 1498668236,
			["zone"] = "Stormwind City - Dwarven District",
			["about"] = {
				["v"] = 12,
				["BK"] = 7,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\LFGFRAME\\LFGICON-STRATHOLME:256:256}\n{h1:c} {link*http://orig05.deviantart.net/22ca/f/2017/174/5/6/lataei_trustfelt_by_raedin-dbdqtne.png*Latæi} {/h1}\n{h1:c}{link*https://www.youtube.com/watch?v=Kg2sdTf5EIg*Trustfelt}{/h1}\n{col:000a12}\nAs a daughter of the smith, Latæi spent a lot of her time in the life of common folk. Their daily lives were often getting troublesome, considering the harsh mountain winters and all kinds of unsavory creatures constantly bothering them. As one of three more fortunate siblings, she survived through her youth. Her brother, not seeing point in such life, left the family in attempt to secure better future for himself. Latæi and her sister, Svæin, were the only ones left to help around with their father's craft. The girls were mutually keen about mastering the art of smithing and a fair share of harsh work.\n\nAfter few years, even her sister departed. The 14 years old Svæin was sent toward studies of light of her mother's volition. A year younger Latæi, had no say in this. Despite the mourning for her dear sister, the days carried on...\n\nMany winters passed through the mountains, many summers molten their icy blanket. The life, drowsy as it may have been, would go on. It would go on but for a very few... for on Latæi's 19th winter, the village set ablaze, as the howling brutes trampled many to bloodied dust. Clatter of swords, bashing of shields, cries, screams and calls... carried through the frigid, fiery night. \n\nTrembling, bloodied and dusty the fortunate few stood. They stood to gaze upon the sea of claret, mixed in with the snow and dirt. The brutes were turned to flight, great many of them felled. The village, reduced to naught but char and ash as it smoldered through it's final morning. The keen of the living few, carried across their countless dead kinsmen. Among them, the girl with golden hair would kneel... clutching her bloodied sword, the claret eyes open wide as she stared in woeful acrimony...\n\nThe little that remained, the dozen survivors would take with them on their gloomy leave. Where? Nearly none of them knew, but walk they must, for their lives have not yet been concluded. Latæi faced very few options herself. Clad in the armour, smithed in the forge's warmth with her sister, picking up her father's sword... she left for northern lands of wealth and myth, to seek a life anew, to seek her sister aloof.\n\n",
				},
