					["TX"] = "{h1:c}Physical Appearance{/h1}\n\n{link*http://tinyurl.com/zqkpv29*Argent Archives}\n\n{col:85d8db}Standing around six-foot, one inch, DeWitt would seem to be a quiet figure, always looking as if he's merely going about his own business, not very mindful of other people. Unless shouting.\n\nHis physique would be a athletic, clearly someone who can take punches and just as easily throw them back, however he'd not be the beacon of physical health, the perceptive could notice a extremely slight limp as he'd walk. \nHowever, he'd always be seen walking around with his back straight and shoulders, looking rather tense and or contemplating.\n\nHis hair would have his hair cut short, usually having it combed \nto create a parting on down the middle of his hair, along with very short and trimmed sideburns. His facial hair would be nonexistent beyond a constant small amount of stubble.\n\nFacially, he looks like someone who would need a drink, a lot of life insurance, and a vacation. Although still rather youthful this would be completely overshadowed at times by an almost constant contemplative expression, most likely a by-product of his job. Often appearing rather detached, with his expression.\n\nVocally, DeWitt would have hoarse voice, the harshness occurring from years of smoking.\n\n{col:d9caff}============================================================{/col}\n{h1:c}Equipment{/h1}\n\n{col:85d8db}Resting comfortably in his thigh holster would be a worn looking revolver, it features a metallic finish with a few scratches.\nEngraved on the barrel are the words \"I knew we'd see eye to eye.\" \nThe grip has the symbol of The Alliance, engraved on the sides.\n\nNothing about the mechanics of the revolver would be too fancy, not being a double-action or having a speed loader.\n\nAttached to his belt would a few notable items, those being a hardback book, a small ram-skin pouch and tucked into the back of his belt would be a rusty hunting knife, along with a inscribed copper pocket watch.{/col}\n",
