				},
				["PE"] = {
				},
				["v"] = 11,
			},
			["time"] = 1498337482,
			["zone"] = "Stormwind City - The Canals",
			["about"] = {
				["T1"] = {
					["TX"] = "Before you stands a tall man, being at age of around third decade.\n\nLooking at his face, your attention is drawn by a single eye of color of deep blue. giving the impression that pierces throuugh anyone it is set upon. His gaze speaks of both the life experience and fatigue. His other eye is hidden behind an old looking, leather eye-patch.\n\nA medium sized nose, slightly crooked to the side. His lips are big, filtered with taste of burnt tobacco and consumed rum.\nHis stubble covers half of his face, always well trimmed as it seems he puts alot of care into his look.\n\nHair in color of black pitch falls down his shoulders when loose. However, this man is always keeping it up tied in a pony-tail. A few single locks are always falling onto his slightly wrinkled face.\n\nUpon studying his posture, you can easily guess that the man standing before you has a military past. His build is broad and well built. Scars can be seen on many spots of his body.\n\nMany tattoos. Most of them hidden under his armour. One of them is visable. A full sleeve-type tattoo covering his whole right arm, representing memories of his past.\n\n\n\"Glory , honor, pride , heritage .. Unfortunately, these features are guided by the knights of the stories for little boys and girls. Knighthood. I'll tell you how I see its meaning. All those men walking into the battle with name of the Alliance on thier lips. Im afraid these times are behind us. Not this is making a real knight but the things he is loyal too, the things he set as important himself, not the rules imposed by the pervious years, decades, centuries. My father, Johanatan Dolores, admiral of the grand Tirassian fleet. He was noble born, he was a Knight, but he never represented the features one should follow. While fighting, he was inspired by the idea of better future of his children, safety of his family. While always being loyal to the Alliance, he never really fought for the King. He fought for himself and the things he loved, and thats the way Im following myself.\n\nI never wanted to become a noble man, attending all the banquets, meetings of any kinds.. my place is on the battlefield, eaither on the sea or land. Yet I got pulled into this because of the things that happend in the past.\n\nLooking at me what can you see? Im just as same soldier as any private, Knight is just a title, but if this title will allow me to change anything, to get some good men and women to come with me, to fight for the better good. I'll do everything in my power to do this.\"\n\n\n-- Dolores about Knighthood,\ninterlocutor: unknown.\n",
				},
