					["2"] = {
						["AC"] = true,
						["TI"] = "Jewellery",
						["IC"] = "inv_misc_kingsring2",
						["TX"] = "Evie would be seen wearing:\nA golden arm cuff, coiling up her upper arm.\nA single golden nose ring, worn in her right nostril.\nSeveral different rings, dotted on her fingers. Mostly gold, one wooden.\nA pair of silver earrings, each fitted with a large, lustrious white pearl.\nAn expensive, gold-chained, onyx pendant necklace.\nA gold open-bangle bracelet, adorned with emerald flower end caps.\nA gold chained, half-heart pendant necklace.",
