				["TE"] = 1,
				["T1"] = {
					["TX"] = "<UNDER CONSTRUCTION>\n\n{h1}Appearance{/h1}\n\nHou is a fairly muscular pandaren, with broad shoulders, thick arms and a wide, muscular chest. This is somewhat obscured, however, by his healthy pandaren belly, and the thick fur that covers him. It ranges in colour from near pitch black to ashen gray, and is neatly kept and groomed. His hair is kept somewhat short, and usually always slicked back in a simple, easily groomed fashion. \n\nHous beard is a touch more stylish and cared for than his basic hairstyle, with long sideburns following his jawline and, along with his hair, almost crowns his facial features like a lions mane. His chin is shaven, aside from a long rope beard that reaches almost a foot down across his chest. It's tied with bright red ribbons, almost inviting an attacker to seize in mid-battle. \n\nThere are a few visible scars on his face, notably one across his snout, and a notch in his right ear. A few more are concealed beneath his armour and clothes, but none stand out as anything else than the marks of a life of combat.\n\n{h1}Armour and weaponry{/h1}\n\nHou dresses in relatively light and flexible armour, made primarily of padded hard leather, reinforced with details and studs of ghost iron. More or less the entire set is scarred and coloured by many years of usage, although he always keeps it in pristine condition. He usually only wears his helmet when danger is imminent, otherwise keeping it tied to his belt. Outside of his armour Hou wears a belt around his waist and a bandolier diagonally across his chest. These are filled with pockets, as well as multiple dangling bottles of brewmaster concoctions. \n\nHou uses two distinct weapons in combat, depending on the circumstance. When intimidation and swift lethal strikes are called for, he carries a long polearm of obvious pandaren design. Though it is decades old, with scratches and marks of extensive use, it is kept in prime condition at all times, oiled and razor sharp. \n\nFor situations that call for a less aggressive approach and perhaps non-lethal combat, Hou prefers his traditional brewmasters staff, long and made of the hardest wood. On the business end of the staff dangles a metal stein and a small bottle, although they are more traditional than functional. Still hurts to get struck by one, though. When traveling, Hou keeps both weapons in reach, but whenever he settles down at an inn or campsite, he carries one, leaving the other behind. Besides his main weapon, he always has a small dagger at the back of his belt, for those tricky situations.",
