			["about"] = {
				["T1"] = {
					["TX"] = "Lily's story starts around the age of eight years old. This is when Lily took her first job. At the time her parents were running a farm and struggling financialy. So the young woman decided it would be best for her to earn money. This is how Lily first started down the path of an assassin. From here she would recieve more jobs suited for a child killer as she would refine her skills until it led to the unfortunate demise of her parents. Some time later she would come in contact with a Gilnean who would take her in and raise her as his own. Lily would continue her job as an assassin learning various abilities such as shadow magic until she decided to try live a normal life and join the military.\n\nKeeping her magic a secret in fear of being shamed. Lily helped with militant forces during the siege of Orgrimar. After these events Lily felt like seeing the world without a red haze of blood covering her sight at all times and after a while took work under a lord where she once more embraced shadow magic amongst a group of trusted people. After questionable actions Lily was removed from this job and joined a shadow organisation where she helped fight the iron horde even dissapeering onto Dreanor for some time before returning to Azeroth.\n\nLily would during her time after Dreanor suffer from mental torture and eventualy reach her breaking point which would lead her to cast a spell to split part of her mind from her own, though in an accident her mind would end up split so severely that she would suffer from complete lack of memories, during this time she became known as Titania and trounced around the world killing as she liked.\n\nLater Lily would be rescued thanks to the efforts of an old friend who would then recruit her into his current job, which is where Lily is right now.",
