				["TE"] = 1,
				["T1"] = {
					["TX"] = "\n\n\n\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n{p:c}{col:ffeb79}A grim and disdainful patriot indeed, she maintained a naturally narrowed state, patrolling around her surroundings with near on distrust for those whom wandered, keeping a particularly high guard up because of such, almost as if to say she'd silently judge each and every person around, into her myriad of thoughts.\n \n\nA weather-beaten face sat curved by an angular jawline, ashen and pale skin accompany a visage of withholding a lack of blemishing as as once auburn tresses wove themselves behind her back, now falling a shade of dirty blonde from the sun's light. A chartreuse shade was held captive within a pair of matching orbs to round off her features which were only further accentuated by her thickened ebony lashes.{/col}{/p}\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n\n\n{p:c}{link*https://www.argentarchives.org/node/185298*AA}{/p}",
