			["misc"] = {
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "At first glance",
						["IC"] = "Ability_Shaman_FreedomWolf",
						["TX"] = "Smaller than the average worgen, both in build and size. Could not be more than 2m.\nFur color alternating between brown and gray with a touch of sicklish/diseased white to it.\nA pair of intact, completely blue eyes which have a distant look to them.\nSmall, non-protruding teeth with a closed mouth, giving its muzzle a less feral, yet more wolf like shape.",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Necklace",
						["TX"] = "A small purple shell on a thin chain with the letter S carved in it.",
						["IC"] = "INV_Misc_Shell_01",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Scent",
						["IC"] = "INV_Misc_Herb_TwilightJasmine",
						["TX"] = "A comforting smell of several herbs emanate from the worgen's body.",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Ivira",
						["TX"] = "Being followed by a small, translucent green whelp, which may or may not be visible.",
						["IC"] = "INV_Misc_Head_Dragon_Green",
					},
				},
				["ST"] = {
					["1"] = 2,
					["3"] = 0,
					["2"] = 1,
					["5"] = 3,
					["4"] = 0,
					["6"] = 0,
				},
				["v"] = 65,
			},
			["zone"] = "Halfhill - The Lazy Turnip",
			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "Gilnean survivor who used to be a simple farmer before the war.\nAfter the loss of his beloved at the hands of other Gilneans whom he regarded as brethren, he suffered a complete loss of will and personality.\nHe was transported to Teldrassil along with the rest of the survivors, where he was kept/tended to till the second invasion of the legion. During this time he underwent druid training.\nHe is disconnected with his own memories and even personality, unable to correctly place them as his own or have an exact understanding of how he should regard them.\n\nHe currently familiarizes himself with the world from which he was locked away, vandering, learning.\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\nI have died three times throughout my life.\nThe first time, i died as a fool. A proud Gilnean who thought he was blessed for being born on a specific speck of earth. First i died as i watched the land i grew up on get dragged into the sea, with the remnants flooded by hordes of undead.\n\nThe second time i died as a human. One who thought that all other races are below that of the human ingenuity, identity and essence. The second time i died as my body was bent out of shape by something utterly monstrous, full of rage against everything that dared to show itself in its presence.\n\nThe third time... the third time i died as me. The third time i died as i watched the only thing more precious to me than my own existence torn apart by those i once called my fellow brethren and friends.\n\nIts been four years since Gilneas fell.\nIts been four years since the remnants of what was once me got locked away in the soil and wood of Teldrassil by the druids and priests of Darnassus, and it has been only a couple of months since my Denatharion agreed to hand me back the authority over my own life.\n\nIt is strange when you look at your own life and really cannot say what you are supposed to think or feel.\nSorrow? Anger? Pain? Resentment? Relief? Maybe a twisted sense of happiness for seeing the rational world shatter around of you as you throw off the shackles of sanity?\nWhere does your sense of guilt end and where does reality start? How much are you at fault for what has happened?\nThoughts and burden enough to make anyone crazy, but still none of it compares to the punctuation at the end of the sentence that is grinning back at you, mocking the futility of it all, for none of these thoughts change anything.\n",
				},
				["MU"] = "ZoneMusic\\SholazarBasin\\SB_SholazarWalkDay01",
				["BK"] = 9,
				["v"] = 66,
			},
		},
