			["link"] = {
				["Lyone-ArgentDawn"] = 1,
			},
			["about"] = {
				["T1"] = {
					["TX"] = "{h1:c}{col:1affc5}Physical Description{/h1}\n\n{h1:c}{icon:Achievement_Boss_Lanathel:25}{/h1}\n\n{h3:c}{col:1affc5}Ahriana appears to hold the body of a spell caster. Slender, but fit. She doesn't seem to be as worn as many other humans, likely hinting at a noble upbringing. Her stance is one most associated with someone of such heritage, her shoulders held back and head held up, but not high enough to suggest she were arrogant.{/h3}\n\n{h3:c}{col:1affc5}Her face is one accustomed to smiling; despite her rather contained personality. Her eyes have the tint of something a bit sinister, additional to the red hue within them, which might cause those who are observed to feel a little uneasy. Her skin is a tad pale, though tends to change to a more healthy colour at times seemingly without reason. Otherwise her face is well structured and defined, quite like a Quel'dorei.{/h3}\n\n{h1:c}{col:1affc5}Armour and weaponry{/h1}\n\n{h1:c}{icon:INV_Misc_CataclysmArmorKit_11:25}{/h1}\n\n{h3:c}{col:1affc5}She generally tends to wear armour which is most practical. Leather with a mail underlayer to allow for agility while providing more protection than cloth. She seems to dislike robes, only wearing them in very special circumstances. {/h3}\n\n{h3:c}{col:1affc5}Her blade is simply that; a blade. Some red runes cover its flat sides.{/h3}\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}",
