						["IC"] = "Achievement_Character_Pandaren_Female",
						["TX"] = "Before you stands a typical pandaren, with curved shapes and chubby arms and legs. Do not let it fool you, however, since a close eye can see that Yalia's body is well trained, just as many pandaren.\n\nHer face markings are quite curious, since they form what seem like eyelashes above her markings. Her cheeks consist of white, soft fur, without any details. Her eyes are amber-coloured, although they glow green-blue as she uses her Chi.\n\nHer thick neck leads to her chest-area. Her averigely sized breasts peek out a little, but aren't that impressive compared to other pandaren. Her hips and bum are simulary just very ordinary.\n\nHer fur is coloured white, with dark-brown details and areas. This dark brown fur is most likely due to Yalia's parents, one being a red-coloured pandaren and the other being a black-coloured one.\n\nYalia wears her hair with a tail. The hair is long on the back, but short in front, to prevent discomford when fighting. She has died several stands of hair in what seems like green dye. This dye slightly glows in the dark, indicating it's infused with chi.",
