						["TX"] = "\n\nClothing:\n\nYalia is most commonly seen in her leather Gi. It is very simple, but it serves well in protecting her and allowing her to move swiftly in combat.\n\nShe does have some casual clothing, a simple nightrobe, a set of pyjamas and some formal robes.\n(Just look at her ingame appearance for what she's wearing atm)\n\n",
						["BK"] = 4,
						["IC"] = "INV_Chest_Robe_Panda_A_02",
					}, -- [2]
					{
						["TX"] = "\n\nEquipment:\n\nYalia doesn't have that much weapons with her, if you can even call them weapons. She usually carried two wooden practice swords or a long, bamboo staff. The staff usually has some bottles of tea or ale tied to them.\n\n",
						["BK"] = 2,
						["IC"] = "Class_Monk",
					}, -- [3]
					{
						["TX"] = "\n\nOffensive abilities:\n\nYalia's offensive stance offers her quick, strong strikes, while leaving her defence mostly unattended. Her technices mostly constist of offensive jabs, kicks and punches. All of them can be boosted in strenght, speed and force with the use of Chi. She is also able to manifest ki to form deadly attacks, like creating lightning from her paws, palm-strikes that force to stop the heart with vibrations and boost her strength to be able to smash rocks and steel.\n\n",
						["BK"] = 4,
						["IC"] = "ABILITY_MONK_HURRICANESTRIKE",
					}, -- [4]
					{
						["TX"] = "\n\nHealing abilities:\n\nYalia is quite adept at healing with chi-infused mists. She can use them to mend deep wounds and detox illnesses and poisons. Using them in active combat is a little harder, but she can regenerate her stamina when a fight lasts long.\n\n",
						["BK"] = 2,
						["IC"] = "Ability_Monk_DomeOfMist",
					}, -- [5]
					{
						["TX"] = "\n\nDefensive abilities:\n\nAltough not utilising them often, Yalia is adapt at defending herself as well, using her chi to make her skin as tough as armour, redirecting blows and stonewalling attacks. Her defensive stance relies on reacting to offensive moves towards here and countering with disabling attacks.\n\nHer Chi allows her to catch normal blades and weapons with her bare paws, if she is concentrating on it.\n\n",
						["BK"] = 4,
						["IC"] = "Ability_Monk_Uplift",
					}, -- [6]
					{
						["TX"] = "\n\nOther (non-combative) abilities:\n\nNot all abilities are fit for combat, hence they are either dependant on the enviroment or require heavy concentration. When Yalia is meditating, she is able to achieve unassisted flight. She cannot fight, since she needs to stay in her meditative pose.\n\nShe is also able to briefly walk over water, using her Chi to lower her density to be able to walk over water, but she can't really sustain it for longer then a minute.\n\nAnother ability is her ability to split her mind form her body. She can scout out places with her transparent spirit. She can also use this ability to survive her death, but she cannot return to her body if it is beyond repair, trapping her as a lingering spirit.\n\nBlocking Chi channels in other people's body by pressing certain pressure points. Blocking chi flows can either solve inbalance or parilyze the body.\n\n",
						["BK"] = 2,
						["IC"] = "Monk_Ability_Transcendence",
					}, -- [7]
					{
						["TX"] = "\n\nMishi, jade cloud serpent:\n\nYalia's dear friend, Mishi, is usually flying nearby the monk. It is a grand cloud serpent that serves as both a mount and an ally. The two see eachother as equals, mutual respect being the base of their relationship.\n\n",
						["BK"] = 4,
						["IC"] = "INV_Pet_BabyCloudSerpent",
					}, -- [8]
					{
						["TX"] = "\n\nPersonality:\n\nYalia is a free spirit, always believing that she can improve on her previous limits. She is somewhat proud of her strenght, and will take any oppertunity to test it against worthy foes. But when not feeling like pushing herself, she likes to enjoy life, spending time with friends, drinking kegs away and just enjoying simple things like the beauty of nature and the craftmanship of stone.\n\n",
						["BK"] = 2,
						["IC"] = "INV_Pet_RedPanda_White",
					}, -- [9]
