			["about"] = {
				["v"] = 8,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-ArcaneStorm:512:128}\n{h2:c}Berilani the Novice of Arcane{/h2}\n{h3:c}Greatest Arcanist to be{/h3}\n\n{h2:c}{icon:Achievement_Character_Gnome_Female:25}{/h2}\n\nNot an awful lot can be said about Berilani, she is as she is, your average Gnome. With pitch black hairand big green eyes, Beri simply smiles happily and wanders the world with an intrigued gaze. Always absorbing the information thrown at her as best as she can! \n\nHer hair is up in two puffy tails! She wears a small amount of light red gloss on her soft lips and a bit of blush on her puffy cheeks. Her eyes are surrounded by a thin layer of black, due to eyeliner she applies. Beri seems to be a woman who likes to look good and feel attractive when she blasts her enemies with the Arcane.\n\n\n{h2:c}{icon:INV_Misc_Bag_08:25}{/h2}\nThe Gnome also has a large rucksack on her back, filled with all the stuff she needs; quills, scrolls and tomes! One might see a rolled up scroll poking out once in awhile.",
