						["IC"] = "Achievement_Zone_Sholazar_03",
						["TX"] = "As one of the few humans who came to survive the fall of Kul'tiras, this woman stands forth with experience, she knows how to handle herself at open waters rather well.",
					},
					["3"] = {
						["IC"] = "INV_Weapon_Rifle_40",
						["TI"] = "Rifle",
						["AC"] = true,
						["TX"] = "As a gift from her father, this most modified rifle stands out as a tool of masterful craftmanship. Mahogany along with minor pieces of heartwood decorates this greatly craft rifle.. Should one ever take notice, they'll see carvings written against the wood.",
					},
					["2"] = {
