						["IC"] = "TRADE_ARCHAEOLOGY_MITHRILNECKLACE",
						["TX"] = "This necklace can always be seen worn by Kyleria. It appears to be made out of silver, adorned with naught but a single oval-shaped sapphire that appears well aged. ",
