			},
			["link"] = {
				["Kyleria-ArgentDawn"] = 1,
			},
			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h2:c}{col:51d530}The Ranger{/col}\n{/h2}\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n{p:c}{col:9bcfff}Whether deep within the woods scaling the tall mountains, no one quite covers the terrain as well as the Ranger. One with nature, the Rangers knows the lay of the land better than anyone else. She tames the wilderness and lives as one with the world beyond the sanctuary of the marble walls that shield the rest of humanity from the dangers outside.\n\n\nRampaging through the battlefields as a prowling predator, you hear not the Ranger, but the echoing of her rifle as her victims fall across the field ahead of herself. Her aim is true, mastered through experience others could only dream of. Kyleria has embraced the path, the path of a Ranger, and now sets forth for a better future for both her loved ones and herself.\n\n {/col}\n{/p}\n{p:c}------------------------------------------------------------------------------------------{/p}\n\n{h2:c}{col:51d530}Appearance{/col}{/h2}\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n{p:c}{col:9bcfff}This woman treads forth with a semi-scarred figure, displaying only minor series of untouched skin at both her legs and stomach. The most notable scar travel down her right arm, vertically up to the shoulder. With visable consquences of war donning her features, she strides forth as a natural, prominent beauty.\n\n\n Kyleria's hygiene is what you'd expect out of a woman, she takes to several oils and products to keep both hair and skin in general good health. Her natural auburn-coloured hair runs down her back all the way to just below her shoulders, usually in terms of a ponytail. Beneath her eyes rest her modest nose along with her full, natural, crimson coloured lips.\n\n\nTravelling down her figure you're greeted by a toned, fit body, the result from several years of daily exercising and training. This leaves Kyleria with somewhat a muscular physique, travelling further downwards you find her elegeant, broad thighs followed by her more noticeable average-sized feet. She stands athletic as a whole, and strides forth with natural swaying hips, displaying a sign of confidence both in her appeareance and herself. \n\n\nAlthough somewhat lithe and well fit she strides forth in beauty and elegance. These qualities are reflected in a most graceful behaviour aswell as her well developed figure. With bountiful curves in all the right places, Kyleria stands out with a modest, hour-glass figured body! She can't help but to dwarven other women in her midst, giving them all a run for their money!{/col} {/p}\n\n{p:c}------------------------------------------------------------------------------------------{/p}\n\n{h2:c}{col:51d530}Voice & Behaviour{/col}{/h2}\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n{p:c}{col:9bcfff}With the looks of her now being familiar to you, you begin to realize more  ''lighter '' sides of her. One of those being the fact that no matter what, the woman seems to be in a constant urge to move! Whether it be that she's fiddling with something nor exercising, or as simply moving abouts without ever a stop it stands obvious, a restless woman this is.\n\n\nSomething quite easy to take notice of, despite Kyleria's clear urge to always be on the move is that she tends to improvise quite a lot at most situations. Whether she actually thinks them through stands a mystery, for she does usually end up quite well, in beneficial for her own.\n\n\nKyleria's voice stands sharp and toned, a polished southern accent dons this woman's tongue that usually stands both posh and tranquil by nature. Naught but few of her phrases may be hard to interprit due to the said accent of hers. It's quite easy to take notice when she grows displeased with something or not! She's not a woman to yell, certainly not someone to be yelled at either.{/col}{/p}",
