			["time"] = 1498602526,
			["link"] = {
				["Ambérlé-ArgentDawn"] = 1,
			},
			["about"] = {
				["T1"] = {
					["TX"] = "{h1:c}{col:c36dff}Mai'zara Ann-Marie Reyson\n\"DUSK\"{/h1}{/col}\n{p:c}{link*http://tinyurl.com/duskinspiration*Photo Inspiration for Dusk}\n\n{col:818181}Dusk is short, fiesty, and fierce. This is reflected in her appearance.\n\nHer eyes are a light grey, her flesh is slightly pale, but her hair is a fiery red color - almost fake looking in it's brightness. She wears it back most days - the locks twisted into beautful dreadlocks near the end. The tips would be dyed blonde.\n\nShe's curvy - her waist small, yet chest and hips wide. She's also quite short in both of her forms. Usually found in her human form, she'd not be hard to miss.\n\nIn her worgen form, she has soft, light red fur with speckles of grey over her face and paws. Her claws are sharp and she's quick with them! Her dreadlocks are translated elegantly to her worgen form.\n\nShe wears two daggers on her hips at all times and a flintlock in her left boot. Some knives might be found on her person as well.{/col}{/p}\n",
