			["link"] = {
				["Maruus-ArgentDawn"] = 1,
			},
			["about"] = {
				["T2"] = {
					{
						["TX"] = "Lithe and just below average height for her kind, Maruus' overall stature is not unusual. Her slender figure is worked into a reasonably good physique focused on speed and dexterity, only to often be emphasised by her outfit.\n\nIn most situations, she's clad in light leather-armor with likeminded light armament stored in fine scabbards. This almost always includes at least one dagger at her side for which the scabbard could very well be a heirloom.\n\nRarely covered by her armor is her head. Partially covered  by relatively short black strands, is her severely scarred visage. Peering out from such are her brown eyes, which have a tendency to betray a distant look at times.\n\nHer relatively softly shaped face ends in a slightly sharper chin and her cheeks display a slight gaunt at most times. Much like her figure in general, her nose is slim, and below are her rather pale lips.\n\nWhipped diagonally across her visage is a wicked crack in her skin, where scar tissue has closed  in place of the viscious, if shallow wound. It stands out amongst other lesser scars. Some recent, others fading.",
						["BK"] = 1,
						["IC"] = "Achievement_Character_Human_Female",
					}, -- [1]
					{
						["TX"] = "Mirroring her human form to some extent, Maruus' worgen form is fitted with lithe muscles beneath the coat of pelt. The mostly well kept fur is dark gray, although with variations here and there, most noteably around her snout and eyes.\n\nWith that in mind, she stands roughly at average height of her kind at more or less eight feet. While generally quite civilized and calm, the woman's taller form, of the two, is carved for brutallity. Not through bulging muscles as some take to.\n\nInstead this is mostly visible by the way her bony fingers end up in relatively long claws, sharpened at most times. While kept shorter, the claws extending from her paws tell the same story. True to the saying, her fangs are well-kept an no strangers to being weaponized.\n\nMore subtle hints include the predatorial movements and quiet as well as backswept pointy ears on either side of the long raven strands. Significantly more coarse then her general pelt, the mane bears little resemblence to her human air, colour aside.\n\nNo braids or other such adornment are added to the mane, which provides little in the sense of a stylish hairstyle, more than the occasional locks swept forwards over her forehead, or over her shoulders.\n\nDespite the comparatively ferocious figure, a deepened and perhaps even snarling voice, she usually retains a composed Behavior as well as tone, contradictory to what her figure and form presents.\n\nNaturally, her equipment, scars and the like in general transfers from her human form. In fact her armor in general seems to shift with her form, rather than tearing.",
