						["BK"] = 1,
						["TX"] = "Mirah is a young woman with slender forms, very athlethic so no overly impressive curves. In fact, she is a little boyish of build. \n\nHer long hair is obsidian black with a tendency to get in the way, always messy due to her work and bouncing around like a run-away rubber ball.\n\nShe has tribal tattoos of gypsy and Tanarian origin winding up along her arms and legs, and along her spine. A crescent moon tattoed at the right and left side of her neck, one waxing, one waning. She also sports several piercings in her ears , tongue and navel.\n\nHer clothing and equipment is simple and practical, and usually she wears a knife only as visible weapon. But, on rare occasion she can be seen wearing leather armour and brandishing two scimitars. Nothing fancy, but efficient and well kept.",
