						["IC"] = "INV_Misc_Book_17",
						["BK"] = 1,
						["TX"] = "Mirah was born on the ship \"The Cranky Maiden\" by her mother, a Tanarian Gypsy, who by the time was no more than fifteen. Since then she has been travelling around the world, spending time hunting at the sands of Tanaris and Uldum with her mother's Tribe, The Two Moons, and hunting the open seas with the crew of the Cranky Maiden.\n\nHer upbringing was loving, shared by many \"parents\" after her mother died when she was nine years old. Her restless spirit and nomadic nature not allowing her to sit still or stay in one place for long!\n\nShe is still journeying about to find new adventures and the father she has never known. Not knowing where the next chapter will take her!",
