						["TX"] = "By most standards, Abraham is an average dwarf. To all aspects but his choice of facial hair, which is kept very short and to a reasonable level of tidyness to avoid being grabbed or caught by miscreants, or be a bother to catch a large percentage of his meals. \n\nA few human lifespans of hard work and regular training leave this dwarf with a stocky body shape, that doesn't go to extremes in any sense; Neither is he All Muscle or weight, but a sizeable amount of both.",
