					{
						["TX"] = "Scarring and bruises, among many other rips and tears litter over his skin, a main amount of this seeming to focus upon his hands and forearms, most likely being caused by beasts in a range of sizes. These injuries seem a common occurence, since different wound dressings, markings, and bandages appear from time to time. These wounds and scars seem fairly brutal and unforgiving, certainly painful at the time even if they aren't so bad now.",
