						["TX"] = "Located on the top of this dwarves stocky left arm is a rather in-depth tatoo of a boot stomping onto a rat. The boot quite clearly has toe-caps of steel, and the tatoo details the moment of impact with the pest mentioned before; Leaving the critter both flattened and trailing skin, and then the boot splashed with blood. The heel of the boot is marked with the Insignia of the Alliance, and features some dwarven text below the whole thing; it reads: \"Eta. Magna.\" Both above and below.\n\nIn short, It is a bloodied boot resting on the corpse of a rat, with some dwarven text above and below the main image.\n",
