						["AC"] = true,
						["TI"] = "A Bond, forged by battle and bloodshed.",
						["IC"] = "Ability_Hunter_BeastCall",
						["TX"] = "A tough and uncommonly compassionate ex-mountaineer.\n\nAbraham and his faithful gilnean hound work in tandem to bring down their enemies and protect those who need it.  Both can handle themselves, and both can protect eachother just the same.\n\nWho is watching your back? ",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Harrying Companion",
						["IC"] = "Spell_Hunter_LoneWolf",
						["TX"] = "A master is rarely seen without one of his fearless hounds in tow. Though only one follows coiled by a tight leash, it looks well cared for and fed, being very short haired for its breed, with a constant alert for trouble and sudden movements. \n\nMostly docile if its master is present, though while alone can become -very- swiftly agressive for no apparent reason. ",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Wound care",
						["IC"] = "INV_MISC_BAG_09",
						["TX"] = "Abrahams focus is on damage evasion over mitigation, His simple tools are effective for stunning an enemy, but the crippling blows are dealt by his hound after an invigorating snack.\n\n\nBesides general storage, a pouch consisting of 2 packs either side of his waist carry a few snacks and treats for his hound, and essentials like bandages and maps of intended locations.",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Lawbringer",
						["IC"] = "Creatureportrait_Blackrock_ChainsOfWoe",
						["TX"] = "A leash of chain that can be loosened from its coil around the handlers arm to allow the hound much more free movement. The strong metal-looped chain leash is often kept tightly coiled; Untill a situation calls for its release. \n\nHalf way along these loops is a release pin keeping both halves locked together.\n\nAdditionally kept handy in a simple loop of leather is a heavy blacksmithing hammer, blunt and easy to swing.",
