		["1213190157hVCHI"] = {
			["character"] = {
				["CO"] = "-Recruiting for The Blackflag.\n-Accepts assassination contracts. Theme: Gorillaz- Feels Good Inc.\n-Voice:Edward Kenway(AC4)",
				["RP"] = 1,
