			},
			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\BlackMarket\\BlackMarketSign:256:128}{h2:c}\"For years I've been rushing around, taking whatever I fancied, not giving a tinker's curse for those I hurt. Yet here I am... with riches and reputation, feeling no wiser than when I left home. And when I turn around, and look at the course I've run... there's not a man or woman that I love left standing beside me.\"{/h2}\n\n{img:Interface\\Pictures\\artifactbook-rogue-cover:256:256}\n\n{h1:c}Backstory{/h1}\n\n{h3}\"In progress{/h3}\n\n{img:Interface\\Pictures\\artifactbook-rogue-kingslayers:512:256}\n\n{h1:c}Equipment{/h1}\n\n{h2}Hidden Blades{/h2}\"Given to him from a gnomish engineer, a real engineering masterpiece. The hidden blade sheathes itself in and out depending on the equippers finger movement.\"\n\n{h2}Six Flintlocks{/h2}\"Four flintlocks on the harness that is attached to his shirt and two attached to his utility belt, this guy looks like a ship on his own.\n\n{h2}Dagger{/h2}\"A dagger with a little skull at the end of the hilt with writings on the steel part of the dagger.\"\n\n{h2}Sleep and Poisionous Darts{/h2}\"From a trip way back to Stranglethorn, Alan has 12 sleep darts and 6 poisionous ones in his pouch with a blowdart attached to his belt.\"\n\n{h1:c}Appeareance{/h1}\n\n{h2:c}\"A blonde, blue eyed, clean faced and a heavy bearded man. A slice mark going over  his right eye, only seen scar with no negative effect to his sight. His armor would be a mixture of Blue, Black, White, Brown Leather and Red. He is tall and fit with a six pack that can be seen clearly. When he has taken his stacks of armor off you can see he has a huge skull tattoo on his chest, the symbol of the Jolly rodger to be exact.\"{/h2}\n\n{h1}Visual reference:{/h1}{link*http://imgur.com/a/Ij0V3*Alan with his brother(Artist in bio)}\n\n{h1}Visual reference:{/h1} {link*https://vignette4.wikia.nocookie.net/assassinscreed/images/4/45/Edward_Kenway_rear_view_concept.jpg/revision/latest?cb=20131107005641*Alan from the back.}",
